import React from 'react';
import NavBar from '../header';
import './home.css';
import MeOnHike from './MeOnHike.jpg';
import { Box, Heading, Text, Image } from '@chakra-ui/react';

const Home = (props) => {

  return (
    <div className = 'homeDiv'>

      <NavBar />

      <div
      style = {{width: '100%'}}
      margin = 'auto'>
        {/* <h1 className = 'homeHeader'>
          A Little Info About Me
        </h1> */}

        <Box
        display={ "inline-block" }
        width={{ sm: "full", md: "auto" }}
        alignItems="center"
        maxWidth = '550px'
        margin = '25px'>

          <Heading size = 'lg'>
            Welcome to my Site
          </Heading>


          <br />
          <br />

          <Text
          fontSize = 'lg'>
            Hello! My name is Wills Stern. I'm a junior at San Ramon Valley High School and working 
            on my Associate Degree in Computer Science from DVC (I'm on track to receive both around 
            the same time). My interests include programming in general, AI/ML (still learning), 
            Uno R3 automation (Still learning), and learning new technologies.
          </Text>
        </Box>


        <Box
        display={ "inline-block" }
        width={{ sm: "full", md: "auto" }}
        alignItems="center"
        maxWidth = '550px'
        margin = '50px'>

        <Image
          borderRadius = "full"
          width = '150px'
          size = '1500%'
          src = {MeOnHike}
          alt = "Wills Stern"
        />

        </Box>

      </div>

    </div>
    )
};

export default Home;
